tables.table_schema:
CREATE TABLE WeatherData (
  Date TIMESTAMP,
  Temperature INT,
  Humidity FLOAT,
  Pressure INT
);

CREATE TABLE weather_predictions (
    id INT PRIMARY KEY,
    date DATE,
    predicted_temperature FLOAT,
    predicted_humidity FLOAT
);

CREATE TABLE weather_data (
    date DATE,
    temperature FLOAT,
    humidity FLOAT,
    precipitation FLOAT
);

CREATE TABLE city (
    city_name VARCHAR(50),
    country VARCHAR(50)
);

CREATE TABLE weather_predictions (
    date DATE,
    prediction FLOAT
);

CREATE TABLE Location (
    location_id INT PRIMARY KEY,
    city VARCHAR,
    country VARCHAR
);

CREATE TABLE WeatherForecast (
    forecast_id INT PRIMARY KEY,
    date DATE,
    predicted_temperature FLOAT,
    predicted_humidity FLOAT
);

CREATE TABLE WeatherTrends (
    trend_id INT PRIMARY KEY,
    start_date DATE,
    end_date DATE,
    trend_description VARCHAR
);

CREATE TABLE weather_station (
    station_id INT PRIMARY KEY,
    station_name VARCHAR(255) NOT NULL,
    location VARCHAR(255) NOT NULL
);

CREATE TABLE temperature_data (
    data_id INT PRIMARY KEY,
    station_id INT NOT NULL,
    temperature FLOAT NOT NULL,
    date DATE NOT NULL
);

CREATE TABLE humidity_data (
    data_id INT PRIMARY KEY,
    station_id INT NOT NULL,
    humidity FLOAT NOT NULL,
    date DATE NOT NULL
);

CREATE TABLE precipitation_data (
    data_id INT PRIMARY KEY,
    station_id INT NOT NULL,
    precipitation FLOAT NOT NULL,
    date DATE NOT NULL
);

CREATE TABLE weather_trends (
    trend_id INT PRIMARY KEY,
    trend_description VARCHAR(255) NOT NULL,
    date_range VARCHAR(255) NOT NULL
);
